import './styles/main.css'; // Убедитесь, что файл существует

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <BrowserRouter> {/* Убрал StrictMode для упрощения диагностики */}
    <App />
  </BrowserRouter>
);
